import { Component, OnInit } from '@angular/core';
import { FormBuilder, FormGroup, Validators, ReactiveFormsModule } from '@angular/forms';
import { HttpClient, HttpClientModule } from '@angular/common/http';
import { CommonModule } from '@angular/common';
import { FormsModule } from '@angular/forms';
import jsPDF from 'jspdf';

@Component({
  selector: 'app-issue-permit',
  standalone: true,
  imports: [CommonModule, HttpClientModule, ReactiveFormsModule, FormsModule],
  templateUrl: './issue-permit.component.html',
  styleUrls: ['./issue-permit.component.css']
})
export class IssuePermitComponent implements OnInit {
  permitForm: FormGroup;
  units: any[] = [];
  openingBalances: any[] = [];
  itemsList: any[] = [];
  preview: any = null;
  successMessage = '';
  warningMessage = '';

  rows: any[] = [
    { itemName: '', quantity: '', available: '', specialization: '', notes: '' },
    { itemName: '', quantity: '', available: '', specialization: '', notes: '' },
    { itemName: '', quantity: '', available: '', specialization: '', notes: '' },
    { itemName: '', quantity: '', available: '', specialization: '', notes: '' },
    { itemName: '', quantity: '', available: '', specialization: '', notes: '' },
  ];

  headerFields = {
    number: '',
    date: '',
    requester: ''
  };

  constructor(private fb: FormBuilder, private http: HttpClient) {
    this.permitForm = this.fb.group({
      unitName: ['', Validators.required],
      itemName: ['', Validators.required],
      stockNumber: ['', Validators.required],
      requiredQuantity: [1, [Validators.required, Validators.min(1)]],
      requestNumber: ['', Validators.required]
    });
  }

  ngOnInit(): void {
    this.loadUnits();
    this.loadOpeningBalances();
    this.loadItemsList();
    // Always start with 5 empty rows
    this.rows = [
      { itemName: '', quantity: '', available: '', specialization: '', notes: '' },
      { itemName: '', quantity: '', available: '', specialization: '', notes: '' },
      { itemName: '', quantity: '', available: '', specialization: '', notes: '' },
      { itemName: '', quantity: '', available: '', specialization: '', notes: '' },
      { itemName: '', quantity: '', available: '', specialization: '', notes: '' },
    ];
  }

  loadUnits() {
    this.http.get<any[]>('http://localhost:3000/units').subscribe(data => this.units = data);
  }

  loadOpeningBalances() {
    this.http.get<any[]>('http://localhost:3000/openingBalances').subscribe(data => this.openingBalances = data);
  }

  loadItemsList() {
    this.http.get<any[]>('http://localhost:3000/items').subscribe(data => this.itemsList = data);
  }

  onItemNameChange() {
    const itemName = this.permitForm.get('itemName')?.value;
    const item = this.itemsList.find(i => i.itemName === itemName);
    if (item) {
      this.permitForm.get('stockNumber')?.setValue(item.stockNumber);
    } else {
      this.permitForm.get('stockNumber')?.setValue('');
    }
  }

  onRowItemChange(row: any) {
    const item = this.itemsList.find(i => i.itemName === row.itemName);
    if (item) {
      // Find available quantity from openingBalances
      const balance = this.openingBalances.find(b => b.itemName === item.itemName);
      row.available = balance ? balance.quantityAvailable : '';
    } else {
      row.available = '';
    }
  }

  previewPermit() {
    if (this.permitForm.invalid) {
      this.warningMessage = 'يرجى تعبئة جميع الحقول بشكل صحيح.';
      setTimeout(() => this.warningMessage = '', 4000);
      return;
    }
    const { itemName, stockNumber, requiredQuantity } = this.permitForm.value;
    // Normalize values for robust comparison
    const normalizedItemName = (itemName || '').toString().trim();
    const normalizedStockNumber = (stockNumber || '').toString().trim();
    const balance = this.openingBalances.find(b =>
      (b.itemName || '').toString().trim() === normalizedItemName &&
      (b.stockNumber || '').toString().trim() === normalizedStockNumber
    );
    if (!balance) {
      this.warningMessage = 'العنصر غير موجود في الأرصدة الافتتاحية.';
      setTimeout(() => this.warningMessage = '', 4000);
      return;
    }
    if (requiredQuantity > balance.quantityAvailable) {
      this.warningMessage = 'الكمية المطلوبة أكبر من الكمية المتوفرة.';
      setTimeout(() => this.warningMessage = '', 4000);
      return;
    }
    this.preview = { ...this.permitForm.value, status: 'pending' };
  }

  confirmPermit() {
    if (!this.preview) return;
    const permit = { ...this.preview };
    this.http.post('http://localhost:3000/issuePermits', permit).subscribe({
      next: () => {
        this.successMessage = 'تم حفظ إذن الصرف بنجاح!';
        setTimeout(() => this.successMessage = '', 4000);
        this.preview = null;
        this.permitForm.reset();
        this.permitForm.get('requiredQuantity')?.setValue(1);
      },
      error: () => {
        this.warningMessage = 'حدث خطأ أثناء حفظ إذن الصرف.';
        setTimeout(() => this.warningMessage = '', 4000);
      }
    });
  }

  saveHeaderFields() {
    const dataToSave = {
      header: { ...this.headerFields },
      rows: this.rows
    };
    this.http.post('http://localhost:3000/issuePermits', dataToSave).subscribe({
      next: () => {
        // Show Bootstrap alert
        this.successMessage = 'تمت الإضافة بنجاح!';
        setTimeout(() => this.successMessage = '', 4000);
        // Clear form data
        this.headerFields = { number: '', date: '', requester: '' };
        this.rows = [
          { itemName: '', quantity: '', available: '', specialization: '', notes: '' },
          { itemName: '', quantity: '', available: '', specialization: '', notes: '' },
          { itemName: '', quantity: '', available: '', specialization: '', notes: '' },
          { itemName: '', quantity: '', available: '', specialization: '', notes: '' },
          { itemName: '', quantity: '', available: '', specialization: '', notes: '' }
        ];
        // Generate and download PDF
        this.generatePDF(dataToSave);
      },
      error: () => {
        this.warningMessage = 'حدث خطأ أثناء حفظ بيانات النموذج.';
        setTimeout(() => this.warningMessage = '', 4000);
      }
    });
  }

  async generatePDF(data: any) {
    const jsPDFModule = await import('jspdf');
    const doc = new jsPDFModule.jsPDF({ orientation: 'p', unit: 'mm', format: 'a4' });
    // Load and add Arabic font (e.g., Amiri-Regular.ttf as base64)
    // You must convert your TTF font to base64 and add it here
    // Example: doc.addFileToVFS('Amiri-Regular.ttf', '<base64-string>');
    // doc.addFont('Amiri-Regular.ttf', 'Amiri', 'normal');
    // doc.setFont('Amiri');


    doc.addFileToVFS('Amiri-Regular.ttf', '');
  doc.addFont('Amiri-Regular.ttf', 'Amiri', 'normal');
  doc.setFont('Amiri');
  doc.setFontSize(16);



    doc.text('المملكة العربية السعودية', 105, 15, { align: 'center' });
    doc.text('وزارة الداخلية', 105, 23, { align: 'center' });
    doc.text('الإدارة العامة لتقنية وأمن المعلومات', 105, 31, { align: 'center' });
    doc.setFontSize(14);
    doc.text('نموذج إذن صرف وإخراج', 105, 41, { align: 'center' });
    doc.setFontSize(12);
    doc.text(`الرقم: ${data.header.number || ''}`, 180, 55, { align: 'right' });
    doc.text(`التاريخ: ${data.header.date || ''}`, 130, 55, { align: 'right' });
    doc.text(`الجهه الطالبه: ${data.header.requester || ''}`, 80, 55, { align: 'right' });
    doc.text('الموضوع: أمر صرف من المستودع', 20, 55);
    // Table header
    doc.setFontSize(11);
    doc.text('م', 190, 70);
    doc.text('الصنف / المادة', 170, 70);
    doc.text('الكمية', 130, 70);
    doc.text('المتوفر', 110, 70);
    doc.text('إدارة تخصص', 80, 70);
    doc.text('ملاحظات', 40, 70);
    // Table rows
    let y = 80;
    data.rows.forEach((row: any, i: number) => {
      doc.text(String(i + 1), 190, y);
      doc.text(row.itemName || '', 170, y, { align: 'right' });
      doc.text(row.quantity ? String(row.quantity) : '', 130, y, { align: 'right' });
      doc.text(row.available ? String(row.available) : '', 110, y, { align: 'right' });
      doc.text(row.specialization || '', 80, y, { align: 'right' });
      doc.text(row.notes || '', 40, y, { align: 'right' });
      y += 10;
    });
    // Checkboxes and instructions
    doc.setFontSize(12);
    doc.text('إلى مأمور المستودع', 180, y + 10, { align: 'right' });
    doc.text('☐ يعتمد الصرف حسب الجدول الموضح أعلاه وتستكمل كافة الإجراءات اللازمة', 180, y + 20, { align: 'right' });
    doc.text('☐ يتعذر الصرف', 180, y + 30, { align: 'right' });
    // Signature section
    doc.text('رئيس قسم التموين المكلف', 180, y + 45, { align: 'right' });
    doc.text('مدير إدارة تقنية وأمن المعلومات بالقطاع الشرقي', 60, y + 45, { align: 'right' });
    doc.save('issue-permit.pdf');
  }
}
